import React from 'react'
import Navbar from './Navbar'
import Header from './Header'
import { makeStyles } from '@material-ui/styles'

const useStyles = makeStyles({
  particlesCanva: {
    position: "absolute",
    opacity: "0.7"
  }
})

const Home = () => {

  const classes = useStyles()

  return (
    <>
      <Navbar />
      <Header />
      canvasClassName={classes.particlesCanva}
        params={{
          particles: {
            number: {
              value: 45,
              density: {
                enable: true,
                value_area: 1500
              }
            },
            shape: {
              type: "circle",
              stroke: {
                width: 1,
                color: "#D7B46A"
              }
            },
            size: {
              value: 8,
              random: true,
              anim: {
                enable: true,
                speed: 4,
                size_min: 0.1,
                sync: true,
              }
            },
            opacity: {
              value: 1,
              random: true,
              anim: {
                enable: true,
                speed: 0.5,
                opacity_min: 0.5,
                sync: true
              }
            },
            color: "D7B46A"
          }
        }}
      />
    </>
  );
};

export default Home;
